import React from "react";

const Title = () => {
    return (
        <div className="title">
            <h1>Street Art</h1>
            <h2>Art Gallery</h2>
            <p>Here is the Street Art around you! Please enjoy every moment.</p>
        </div>
    );
};

export default Title;
